import React, { useState }  from 'react';
import "../../styles/Register.css";

function AddClinic() {
      // State and functions for Monday
  const [showMondayDropdown, setShowMondayDropdown] = useState(false);
  const [selectedBeginTimeMonday, setSelectedBeginTimeMonday] = useState("");
  const [selectedEndTimeMonday, setSelectedEndTimeMonday] = useState("");

  // Function to toggle the dropdown visibility and update the selected times for Monday
  const handleMondayCheckboxChange = (e) => {
    setShowMondayDropdown(e.target.checked);
    setSelectedBeginTimeMonday("");
    setSelectedEndTimeMonday("");
  };

  // State and functions for Tuesday
  const [showTuesdayDropdown, setShowTuesdayDropdown] = useState(false);
  const [selectedBeginTimeTuesday, setSelectedBeginTimeTuesday] = useState("");
  const [selectedEndTimeTuesday, setSelectedEndTimeTuesday] = useState("");

  // Function to toggle the dropdown visibility and update the selected times for Tuesday
  const handleTuesdayCheckboxChange = (e) => {
    setShowTuesdayDropdown(e.target.checked);
    setSelectedBeginTimeTuesday("");
    setSelectedEndTimeTuesday("");
  };

    // State and functions for Wednesday
    const [showWednesdayDropdown, setShowWednesdayDropdown] = useState(false);
    const [selectedBeginTimeWednesday, setSelectedBeginTimeWednesday] = useState("");
    const [selectedEndTimeWednesday, setSelectedEndTimeWednesday] = useState("");

    // Function to toggle the dropdown visibility and update the selected times for Wednesday
    const handleWednesdayCheckboxChange = (e) => {
        setShowWednesdayDropdown(e.target.checked);
        setSelectedBeginTimeWednesday("");
        setSelectedEndTimeWednesday("");
    };

    // State and functions for Thursday
    const [showThursdayDropdown, setShowThursdayDropdown] = useState(false);
    const [selectedBeginTimeThursday, setSelectedBeginTimeThursday] = useState("");
    const [selectedEndTimeThursday, setSelectedEndTimeThursday] = useState("");

    // Function to toggle the dropdown visibility and update the selected times for Thursday
    const handleThursdayCheckboxChange = (e) => {
      setShowThursdayDropdown(e.target.checked);
      setSelectedBeginTimeThursday("");
      setSelectedEndTimeThursday("");
    };

    // State and functions for Friday
    const [showFridayDropdown, setShowFridayDropdown] = useState(false);
    const [selectedBeginTimeFriday, setSelectedBeginTimeFriday] = useState("");
    const [selectedEndTimeFriday, setSelectedEndTimeFriday] = useState("");

    // Function to toggle the dropdown visibility and update the selected times for Friday
    const handleFridayCheckboxChange = (e) => {
        setShowFridayDropdown(e.target.checked);
        setSelectedBeginTimeFriday("");
        setSelectedEndTimeFriday("");
    };

    // State and functions for Friday
    const [showSaturdayDropdown, setShowSaturdayDropdown] = useState(false);
    const [selectedBeginTimeSaturday, setSelectedBeginTimeSaturday] = useState("");
    const [selectedEndTimeSaturday, setSelectedEndTimeSaturday] = useState("");

    // Function to toggle the dropdown visibility and update the selected times for Friday
    const handleSaturdayCheckboxChange = (e) => {
        setShowSaturdayDropdown(e.target.checked);
        setSelectedBeginTimeSaturday("");
